import { categories } from "./categorieslist";
import "./categories.css";
import React from "react";

export function Category() {
    return (
      <ul>
        {categories.map(category =>
        <div>
          <li key={category.id}>
            {category.name}
         </li>

       </div>
        ) }
        <br />
      </ul>
    )
}
